  "codeLabFeaturedProject_MagicFortuneTeller.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span>「スタート」をタップして、COZMOのかおに「?」がひょうじされたら、COZMOにうらなってほしいことをきいてみましょう。\u000a\u000a<span style='font-weight:bold;'>2.</span> COZMOを<span style='font-weight:bold;'>ふると</span>、きままにこたえてくれます!\u000a\u000a<hr style='background-color:#bbb; color:#bbb; border:none; height:1px'><span style='font-size:80%; font-color:#ddd'>キューブはひつようありません!</span>"
  },
  "codeLabFeaturedProject_CubeWhack.projectName" : {
    "translation" : "キューブタップ"
  },
  "codeLabFeaturedProject_CubeWhack.projectDescription" : {
    "translation" : "キューブを引っぱたけ！あなたのハイスコアは？"
  },
  "codeLabFeaturedProject_CubeWhack.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> はじめるまえに、COZMOのまえにキューブを3つ<span style='font-weight:bold;'>おきます</span>。\u000a\u000a<span style='font-weight:bold;'>2.</span> COZMOのバックパックライトのいろがへんかします。おなじいろになったら、すばやくキューブを<span style='font-weight:bold;'>タップ</span>します。\u000a\u000a<span style='font-weight:bold;'>3.</span> じかんぎれになるまえに、おなじいろのキューブをできるだけおおく<span style='font-weight:bold;'>タップ</span>してください!\u000a\u000a<span style='font-weight:bold;'>4.</span> じぶんのハイスコアをこうしんできるかな?"
  },
