    "translation" : "[X]秒間待ちます。トラブルシューティング：考えていたよりも早くプロジェクトが終了していませんか？コードブロックが実行されていないとき、プロジェクトは数秒後に自動的に終了します。プレイヤーがキューブをタップするのを待っている場面を想像してみてください。そのとき、プロジェクトの終了までに数秒以上の猶予をプレイヤーに与えたいと思っているとします。「待機」ブロックを追加することによって、自分が思っているよりも早くプロジェクトが終了してしまうことを確実に防ぐことができます。"
